import React, { useState } from "react";

const SearchResult = (props) =>{
    // let [viewImage, setViewImage] =useState("")
    const image_result = `https://source.unsplash.com/400x300/?${props.get}`
    return (
        <>
            <div >
                <img src={image_result} alt="Search-result" width="700px" height="500px" />
            </div>
        </>
    )

}
export default SearchResult;
